      </div>
      <Divider variant="middle" />
            <div className={classes.section3}>
        <Typography align="left" gutterBottom variant="h4">
          Education
        </Typography >
        <DataEntry year={2018} role={""} place={""} description={"bla"}/>
        <DataEntry year={2018} role={""} place={""} description={"bla"}/>
      </div>
            <Divider variant="middle" />
            <div className={classes.section3}>
        <Typography gutterBottom align="left" variant="h4">
          Skills
        </Typography>
      </div>
    </div>
  );
}
